•
A defining moment for me is when I lost the closest person to me, my sister Katie. We ran a restaurant together in a small town in Saskatchewan called the Happy Nun Cafe. She was an amazingly talented chef. We did everything together. After she died, I struggled with anxiety and depression. I was so scared to do anything with my life, I just thought that maybe if I stood still enough, all the craziness and hurt swirling around me would subside. But that’s not how life works, the loss is always there. One day I decided I was done being scared. On a whim, I applied for a working holiday visa to Australia. I work in the wine industry and have always wanted to work internationally. It was the best decision I’ve ever made. I became the best version of myself and made friendships and connections that I will have forever.
•
A role model of mine is my sister. In a male dominated line of work, she had to work twice as hard to get recognition. She did that and more all the while with modesty and grace. Katie is my inspiration for everything I do, especially traveling! I always feel like I’m bringing her along with me in a way every time I experience a new place. She taught everyone how to live their best life ❤️
•
Advice I would share with other women is to always do the thing that scares you the most and to challenge standards.
•
I have traveled to Italy, Spain, Portugal, Iceland, U.S.A, Germany, Greece, Scotland, Ireland, Australia, New Zealand, Bali and Singapore. Next up on my travel bucket list is Croatia, Slovenia and Norway
